import React, { Component } from 'react';
import maintitle from './images/main-title.svg';
import './App.css';

class App extends Component {
    render() {
        return (
            
            <div className="App">
                <View style={styles.container}></View>
                <img className="main-title" src={maintitle} height="80"/>
            </div>
        );
    }
}

export default App;
